// Fire-and-forget analytics tracking
const trackEvent = (eventName, walletAddress = null, twitterUsername = null, metadata = {}) => {
  if (!isSupabaseConfigured()) return;
  supabase.functions.invoke('track-event', {
    body: { event_name: eventName, wallet_address: walletAddress, twitter_username: twitterUsername, metadata }
  }).catch(() => {}); // Silent fail - don't impact UX
};

// Confetti component
const Confetti = ({ active }) => {
  const [particles, setParticles] = useState([]);
  
  useEffect(() => {
    if (active) {
      const newParticles = [...Array(100)].map((_, i) => ({
        id: i,
        x: Math.random() * 100,
        delay: Math.random() * 0.5,
        duration: 2 + Math.random() * 2,
        color: ['#D5E59B', '#4ADE80', '#F7F7E8', '#FFD700', '#FF6B6B'][Math.floor(Math.random() * 5)],
        size: 6 + Math.random() * 8,
        rotation: Math.random() * 360
      }));
      setParticles(newParticles);
    }
  }, [active]);

  if (!active) return null;

  return (
    <div style={{
      position: 'fixed',
      inset: 0,
      pointerEvents: 'none',
      zIndex: 100,
      overflow: 'hidden'
    }}>
      {particles.map(p => (
        <div
          key={p.id}
          style={{
            position: 'absolute',
            left: `${p.x}%`,
            top: '-20px',
            width: `${p.size}px`,
            height: `${p.size}px`,
            backgroundColor: p.color,
            borderRadius: Math.random() > 0.5 ? '50%' : '2px',
            transform: `rotate(${p.rotation}deg)`,
            animation: `confettiFall ${p.duration}s ease-out ${p.delay}s forwards`
          }}
        />
      ))}
    </div>
  );
};

// Animated counter component
const AnimatedCounter = ({ target, duration = 1000 }) => {
  const [count, setCount] = useState(0);
  const [hasAnimated, setHasAnimated] = useState(false);

  useEffect(() => {
    if (hasAnimated) return;
    setHasAnimated(true);
    
    const startTime = Date.now();
    const startValue = Math.max(0, target - 50);
    
    const animate = () => {
      const elapsed = Date.now() - startTime;
      const progress = Math.min(elapsed / duration, 1);
      
      // Easing function for satisfying feel
      const eased = 1 - Math.pow(1 - progress, 3);
      const current = Math.floor(startValue + (target - startValue) * eased);
      
      setCount(current);
      
      if (progress < 1) {
        requestAnimationFrame(animate);
      }
    };
    
    animate();
  }, [target, duration, hasAnimated]);

  return <span>{count.toLocaleString()}</span>;
};

